import React, {Component} from 'react';
import { withFirebase } from '../Firebase';

class SignOutButton extends Component {
  handleClick = event => {
    firebase.doSignOut
  }

  render() {
    <button type="button" onClick={handleClick}> Sign Out </button>
  }
}

export default withFirebase(SignOutButton);
